        <div className='container' id='scenarioDetails'>
        <div className='row'>
            <div className='col'>
                <button >Add Income Event</button>
                <button>Add Expense Event</button>
            </div>
        </div>
        <div className='row'>
            <div className='col'>
                <button type="button" className="btn btn-secondary">Cancel</button>
            </div>
        </div>
        </div>
        )
    }

export default ScenarioDetails;
